import React, { Component } from "react";
import "../css/default.min.css";
import { Route, BrowserRouter as Router } from "react-router-dom";
import main from '../components/Mainpage'
class Navbar extends Component {
  render() {
    return (
      <Router>
        <nav className="navigation">
          <ul>
            <li>
              <Route path='/Mainpage' Component={main}>Not a member? Visit the DTE website.</Route>
            </li>

            <li>
              <a href="https://www.instagram.com/ufdreamteam/?hl=en">
                Instagram
              </a>
            </li>
            <li>
              <a href="https://www.facebook.com/UFDreamTeam/">Facebook</a>
            </li>
          </ul>
        </nav>
      </Router>
    );
  }
}

export default Navbar;
